import React, { useState } from "react";
import { Footer, Navbar } from "../components";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";

const Customer = () => {
  const state = useSelector((state) => state.handleCart);
  const [customerDetails, setCustomerDetails] = useState({
    name: "",
    email: "",
    phone: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    // Limiting input fields to 15 characters
    if (value.length <= 15) {
      setCustomerDetails((prevDetails) => ({
        ...prevDetails,
        [name]: value,
      }));
    }
  };

  const sendDataToBackend = async (data) => {
    try {
      const response = await fetch("http://localhost:3000/customer/orderSubmit", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
      });

      if (response.ok) {
        const responseData = await response.json();
        console.log("Checkout successful!", responseData);
        // Handle success, e.g., redirect to thank you page
      } else {
        throw new Error("Checkout failed");
      }
    } catch (error) {
      console.error("Error occurred during checkout:", error);
      // Handle error, e.g., show error message to user
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent form submission and page reload

    const data = {
      customer: customerDetails,
      products: state.map((item) => ({
        product_id: item.product_id,
        quantity: item.qty,
        price: item.price,
      })),
    };

    sendDataToBackend(data);
  };

  const EmptyCart = () => (
    <div className="container">
      <div className="row">
        <div className="col-md-12 py-5 bg-light text-center">
          <h4 className="p-3 display-5">No item in Cart</h4>
          <Link to="/" className="btn btn-outline-dark mx-4">
            <i className="fa fa-arrow-left"></i> Continue Shopping
          </Link>
        </div>
      </div>
    </div>
  );

  const ShowCheckout = () => (
    <div className="container py-5" style={{ marginTop: '100px' }}>
      <form onSubmit={handleSubmit}>
        <div className="form my-3">
          <label htmlFor="name">Name</label>
          <input
            type="text"
            className="form-control"
            id="name"
            name="name"
            value={customerDetails.name}
            onChange={handleInputChange}
            maxLength="15"
            placeholder="Enter your name (Max 15 characters)"
            style={{ width: '500px' }}
          />
        </div>
        <div className="form my-3">
          <label htmlFor="email">Email</label>
          <input
            type="email"
            className="form-control"
            id="email"
            name="email"
            value={customerDetails.email}
            onChange={handleInputChange}
            maxLength="15"
            placeholder="name@example.com (Max 15 characters)"
            style={{ width: '500px' }}
          />
        </div>
        <div className="form my-3">
          <label htmlFor="phone">Phone</label>
          <input
            type="tel"
            className="form-control"
            id="phone"
            name="phone"
            value={customerDetails.phone}
            onChange={handleInputChange}
            maxLength="15"
            placeholder="Enter your phone number (Max 15 characters)"
            style={{ width: '500px' }}
          />
        </div>
        <button type="submit" className="btn btn-primary">Continue to checkout</button>
      </form>
    </div>
  );

  return (
    <>
      <Navbar />
      <div className="container my-3 py-3">
        <h1 className="text-center">Checkout</h1>
        <hr />
        {state.length ? <ShowCheckout /> : <EmptyCart />}
      </div>
      <Footer />
    </>
  );
};

export default Customer;
